import '../index.css'
import React from 'react'
import Header from './Header'
import Banner from './Banner' 
import Services from './Services'
import Testimonial from './Testimonial'
import News from './News'

class App extends React.Component{
    constructor (){
        super()

    }

    render(){
        return(
            <>
            <Header />
            <Banner />
            <Services />
            <Testimonial />
            <News />
            </>
        )
    }
}

export default App;



